import React, { useEffect, useState } from 'react';
import TrackWorker from './TrackWorker';

const WorkersList = () => {
  const [workers, setWorkers] = useState([]);
  const [selectedWorker, setSelectedWorker] = useState(null);
  const [trackingWorker, setTrackingWorker] = useState(null);
  const [formData, setFormData] = useState({ location: '', doorNumber: '' });
  const [distance, setDistance] = useState('');
  const [arrivalTime, setArrivalTime] = useState('');
  const [bookedWorkerIds, setBookedWorkerIds] = useState([]);
  const [userCoords, setUserCoords] = useState(null);
  const [showBookingPopup, setShowBookingPopup] = useState(false);
  const [showTrackingPopup, setShowTrackingPopup] = useState(false);

  useEffect(() => {
    const fetchWorkers = async () => {
      try {
        const res = await fetch('http://localhost:5000/api/workers');
        const data = await res.json();
        setWorkers(data);
      } catch (err) {
        console.error('Failed to fetch workers:', err);
      }
    };

    const fetchUserLocation = async () => {
      try {
        if (navigator.geolocation) {
          navigator.geolocation.getCurrentPosition(
            (position) => {
              setUserCoords({
                lat: position.coords.latitude,
                lng: position.coords.longitude
              });
            },
            (error) => console.error('Geolocation error:', error)
          );
        }
      } catch (err) {
        console.error('Failed to fetch user location:', err);
      }
    };

    fetchWorkers();
    fetchUserLocation();
  }, []);

  const handleBookClick = (worker) => {
    setSelectedWorker(worker);
    setFormData({ location: '', doorNumber: '' });
    setDistance('');
    setArrivalTime('');
    setShowBookingPopup(true);
  };

  const handleTrackClick = (worker) => {
    setTrackingWorker(worker);
    setShowTrackingPopup(true);
  };

  // ... (keep all other existing functions unchanged)

  return (
    <div style={{ padding: '20px', maxWidth: '1200px', margin: '0 auto' }}>
      <h2 style={{ textAlign: 'center', margin: '20px 0' }}>Available Workers</h2>
      
      {/* Workers Grid */}
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fill, minmax(280px, 1fr))', 
        gap: '20px' 
      }}>
        {workers.map((worker) => (
          <div key={worker._id} style={{
            border: '1px solid #ddd',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
          }}>
            <div style={{ textAlign: 'center' }}>
              {/* Worker photo and details */}
              <button
                onClick={() => handleBookClick(worker)}
                disabled={!worker.available}
                style={{
                  padding: '8px 15px',
                  backgroundColor: worker.available ? '#4CAF50' : '#cccccc',
                  color: 'white',
                  border: 'none',
                  borderRadius: '5px',
                  cursor: worker.available ? 'pointer' : 'not-allowed',
                  marginRight: '10px'
                }}
              >
                Book
              </button>
              <button
                onClick={() => handleTrackClick(worker)}
                style={{
                  padding: '8px 15px',
                  backgroundColor: '#2196F3',
                  color: 'white',
                  border: 'none',
                  borderRadius: '5px',
                  cursor: 'pointer'
                }}
              >
                Track
              </button>
            </div>
          </div>
        ))}
      </div>

      {/* Booking Popup (unchanged) */}
      {showBookingPopup && selectedWorker && (
        {/* Keep your existing booking popup JSX */}
      )}

      {/* Full-page Tracking Popup */}
      {showTrackingPopup && trackingWorker && (
        <div style={{
          position: 'fixed',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          backgroundColor: 'rgba(0,0,0,0.9)',
          zIndex: 2000,
          display: 'flex',
          flexDirection: 'column'
        }}>
          <div style={{
            padding: '20px',
            backgroundColor: '#fff',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center'
          }}>
            <h2 style={{ margin: 0 }}>
              Tracking {trackingWorker.name} ({trackingWorker.workSpecification})
            </h2>
            <button
              onClick={() => setShowTrackingPopup(false)}
              style={{
                background: 'none',
                border: 'none',
                fontSize: '24px',
                cursor: 'pointer',
                padding: '10px'
              }}
            >
              ×
            </button>
          </div>
          
          <div style={{ flex: 1, position: 'relative' }}>
            <TrackWorker 
              worker={trackingWorker} 
              userCoords={userCoords} 
              fullScreen={true}
            />
          </div>
        </div>
      )}
    </div>
  );
};

export default WorkersList;
